"use strict";(self.webpackChunkheidelbergman_site=self.webpackChunkheidelbergman_site||[]).push([[833],{7994:e=>{e.exports=JSON.parse('[{"id":"/2024/08/08/winners","metadata":{"permalink":"/staging/blog/2024/08/08/winners","source":"@site/blog/2024-08-08-winners.md","title":"Sieger Heidelbergman 2024","description":"Race","date":"2024-08-08T00:00:00.000Z","formattedDate":"8. August 2024","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelbergman Orga Team","imageURL":"https://www.heidelbergman.de/img/logo/HD_logo10c.png","key":"orga"}],"frontMatter":{"title":"Sieger Heidelbergman 2024","authors":["orga"]},"unlisted":false,"nextItem":{"title":"Strecken-Sperrungen","permalink":"/staging/blog/2024/07/25/"}},"content":"![Race](/blog/blog_winner01.jpg)\\n\\nUnsere HeidelbergWOMAN und unser HeidelbergMAN 2024: Valerie Moser und Gregor Payet  \ud83d\udc51\\n\\nValerie von den Karlsruher Lemmingen hat die anspruchsvolle Strecke am Sonntag in verdammt schnellen 2 Stunden, 16 Minuten und 51 Sekunden hinter sich gebracht \u26a1\ufe0f\\n\\nDas Frauenpodium wurde durch Laura Jan\xdfen (Team Nikar Heidelberg, 2:17:47) und Ursula Tr\xfctzschler (Team Nikar Heidelberg, 2:19:17) vervollst\xe4ndigt. \\n\\nGregor startet ebenfalls f\xfcr das Team Nikar Heidelberg und ist mit einer Wettkampfzeit von 1 Stunde, 56 Minuten und 45 Sekunden einer der wenigen Athleten, die den HeidelbergMan in unter 2 Stunden bew\xe4ltigt haben \ud83d\udd25 \\n\\nDas M\xe4nnerpodium komplettierten Jakob Breinlinger (Team Nikar Heidelberg, 1:58:39) und Jannik Stoll (Skin Fit Racing Team, 2:00:14). \\n\\nWir gratulieren euch von ganzem Herzen zu euren Wahnsinnsleistungen und hoffen euch bald wieder bei unserem Wettkampf begr\xfc\xdfen zu d\xfcrfen \u2764\ufe0f\\n\\n![Siegering](/blog/blog_winner02.jpg)\\n\\n![Sieger](/blog/blog_winner03.jpg)\\n\\n\ud83c\udf89\ud83c\udf89\ud83c\udf89 Vielen Dank auch an aller Teilnehmer, Helfer, Sponoren, Zuschauer, ....\\nvielen, vielen Dank an euch alle! Ohne euch w\xe4re der ganze Tag nicht nur ein halb so sch\xf6nes Erlebnis geworden, es w\xe4re uns auch niemals gelungen den HeidelbergMAN \xfcberhaupt zur\xfcck zu bringen. \ud83e\udd73\\n\\nUnd auch Gratulation an David Breinlinger - der schnellste Mann am Tag des HeidelbergMan 2024 \ud83d\udd25 \\n\\n\ud83d\udd25 RACE DAY: 28.07.2024 \ud83d\udd25 \\n\\n\ud83d\udccdHeidelberg"},{"id":"/2024/07/25/","metadata":{"permalink":"/staging/blog/2024/07/25/","source":"@site/blog/2024-07-25.md","title":"Strecken-Sperrungen","description":"Liebe Athleten, liebe Zuschauer, liebe Anwohner,","date":"2024-07-25T00:00:00.000Z","formattedDate":"25. Juli 2024","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelbergman Orga Team","imageURL":"https://www.heidelbergman.de/img/logo/HD_logo10c.png","key":"orga"}],"frontMatter":{"title":"Strecken-Sperrungen","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Sieger Heidelbergman 2024","permalink":"/staging/blog/2024/08/08/winners"},"nextItem":{"title":"Finisher Shirt 2024","permalink":"/staging/blog/2024/07/08/TShirt"}},"content":"Liebe Athleten, liebe Zuschauer, liebe Anwohner,\\n\\nam Sonntag, den 28.07.2024, findet der 30. Heidelbergman statt. Wir freuen uns auf ein gro\xdfes Event und viele Zuschauer. Damit der Wettkampf f\xfcr alle Beteiligten reibungslos abl\xe4uft, bitten wir um Verst\xe4ndnis f\xfcr die notwendigen Strecken-Sperrungen.\\n\\nDie Strecken-Sperrungen sind wie folgt:\\n\\n![Strecken-Sperrungen-Schwimmen](/blog/sperrung_schwimmen.webp)\\n\\n![Strecken-Sperrungen-Radfahren](/blog/sperrung_rad.webp)\\n\\n![Strecken-Sperrungen-Laufstrecke](/blog/sperrung_laufen.webp)\\n\\n\ud83c\udf89\ud83c\udf89\ud83c\udf89 Wir freuen uns auf euch!\\n\\n\ud83d\udd25RACE DAY: 28.07.2024 \ud83d\udd25 \\n\\n\ud83d\udccdHeidelberg \\n\\n\ud83d\ude80Feiert mit uns das 30. JUBIL\xc4UM\ud83d\ude80"},{"id":"/2024/07/08/TShirt","metadata":{"permalink":"/staging/blog/2024/07/08/TShirt","source":"@site/blog/2024-07-08-TShirt.md","title":"Finisher Shirt 2024","description":"Staffel","date":"2024-07-08T00:00:00.000Z","formattedDate":"8. Juli 2024","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelbergman Orga Team","imageURL":"https://www.heidelbergman.de/img/logo/HD_logo10c.png","key":"orga"}],"frontMatter":{"title":"Finisher Shirt 2024","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Strecken-Sperrungen","permalink":"/staging/blog/2024/07/25/"},"nextItem":{"title":"Pasta-Party","permalink":"/staging/blog/2024/07/04/pasta"}},"content":"![Staffel](/blog/hdman24_shirt.jpg)\\n\\n\ud83d\udd25Finisher Shirt 2024\ud83d\udd25\\n\\nGemeinsam mit unserem Partner @yellowgreenteam haben wir das diesj\xe4hrige HDMan Finisher Shirt in der Jubil\xe4ums Edition designed.\ud83d\udd25\\n\\nZur Bestellung geht es hier: [Finisher Shirt 2024](https://yellowgreen.de/Teilnehmershirt-zum-HEIDELBERGMAN-2024/HDman2024Shirt)\\n\\nEs handelt sich um ein Unisex Sportshirt und kommt als slimfit Version. Es besteht aus zwei hochwertigen Funktionsstoffen. Die Front ist aus einem Polyestergewebe mit Microl\xf6chern gefertigt, der R\xfccken aus einem Polyestergewebe mit einer Meshstruktur zum besseren Feuchtigkeitstransport.\ud83d\udca7\ud83d\udca6\\n\\nDas Shirt hat ein Nackenband und enger geschnittene \xc4rmel.  Eine Gr\xf6\xdfentabelle findet ihr auf der Website von Yellogreen.\\nDie Rohstoffe wurden in der EU produziert und das Textil in der EU gefertigt. \ud83c\uddea\ud83c\uddfa\\n\\nEs besteht die M\xf6glichkeit, das Shirt im Vorverkauf mit dem Namen bedrucken zu lassen. \\nMaterial: 100% Polyester, Made in EU\\n\\nDas Teilnehmershirt kostet im Vorverkauf 25,- Euro und am Veranstaltungstag 30,- Euro. (So lange der Vorrat reicht). Das im Vorverkauf erworbene Shirt kann am Veranstaltungstag an unserem Verkaufsstand zusammen mit der Rechnung abgeholt werden. \\n\\nSchnell sein lohnt sich! \ud83d\ude80\\n\\n\ud83d\udd25 RACE DAY: 28.07.2024 \ud83d\udd25\\n\\n\ud83d\udccd Heidelberg\\n\\n\ud83d\ude80 Feiert mit uns das 30. JUBIL\xc4UM \ud83d\ude80"}]')}}]);